import React, {Component} from 'react';
import Modal from 'react-awesome-modal';
import { Link } from 'react-router-dom';
import './Modal.css';

class ModalMssg extends Component {
    render() {
        const { visible, closeModal, sentData } = this.props;
        return (
            <section>
                if({sentData}) {
                <Modal 
                    visible={visible}
                    width="600"
                    height="300"
                    effect="fadeInUp">
                    <div>
                      <h1>Please enter your Database Configurations</h1>
                      <p className="modalmssg">As a first time user, please enter your database configurations for uninterrupted use of tool</p>
                      <button className="continuebutton" onClick={closeModal}>Continue</button>
                    </div>
                </Modal>
                }
                else
                {
                <Modal 
                    visible={visible}
                    width="600"
                    height="300"
                    effect="fadeInUp">
                    <div>
                      <h1>Database Configurations Added</h1>
                      <Link to="/Dashboard"><button className="continuebutton" onClick={closeModal}>Continue</button></Link>
                    </div>
                </Modal>
                }
            </section>
        );
    }
}

export default ModalMssg;
